class game {
	constructor() {
		this.player = createPlayer();
		this.socket = null;
		this.canvas = {
			elem: getElem('canvas'),
			ctx: getElem('canvas').getContext('2d'),
			spdX: 0,
			spdY: 0,
			spdX2: 0,
			spdY2: 0,
			x: 0,
			y: 0
		};
		this.extra = {
			upgradeAnim: {
				transparency: 0,
				direction: 'down'
			},
			gamemode: null,
			mouse: [0, 0],
			lastClick: {
				x: 0,
				y: 0
			},
			hovering: false,
			showNames: true,
			chatboxOpen: false,
			showDebug: false
		};
		this.debug = {
			frameTime: 0,
			frameTimes: [],
			lastFrameEnd: 0,
			fps: 0,
			ping: 0,
			tickTimes: [],
			lastTick: 0,
			tps: 0
		};
	}
	spawn() {
		if (this.player.spawned || this.player.spawning) return;
		if (this.socket.connected) {
			this.player = createPlayer();
			this.player.respawning = false;
			this.player.spawning = true;
			var socket = this.socket;
			var buf = new ArrayBuffer(4);
			var dv = new DataView(buf);
			dv.setUint8(0, clPacketTypes.spawn);
			dv.setUint8(1, parseInt(options.gun));
			dv.setUint8(2, parseInt(options.color));
			dv.setUint8(3, parseInt(options.armor));
			socket.send(buf);
			grecaptcha.ready(function() {
				grecaptcha
					.execute('6LeVIngeAAAAAPR_3u6U9NSvFukYtkl6Af_eI5U8', {
						action: 'spawn'
					})
					.then(function(token) {
						let buff = new ArrayBuffer(1),
							dvv = new DataView(buff);
						dvv.setUint8(0, clPacketTypes.grecaptcha);
						socket.send(appendBuffer(buff, toArrayBuffer(token)));
					});
			});
		}
	}
	respawn() {
		if (this.player.respawning) return;
		this.player.respawning = true;
		var buf = new ArrayBuffer(1);
		var dv = new DataView(buf);
		dv.setUint8(0, clPacketTypes.respawn);
		this.socket.send(buf);
		this.canvas.elem.style.display = 'none';
		displayMain();
	}
}

function appendBuffer(buffer1, buffer2) {
	var tmp = new Uint8Array(buffer1.byteLength + buffer2.byteLength);
	tmp.set(new Uint8Array(buffer1), 0);
	tmp.set(new Uint8Array(buffer2), buffer1.byteLength);
	return tmp.buffer;
}

function initializeGame() {
	//btn is sometimes undefined, fix:
	btn = getElem('button-play');
	Game = new game();
	log('Object pools filled', 'green');
	var ca = '.';
	Game.connectingAnimationLoop = setInterval(() => {
		if (ca.length > 3) ca = '.';
		btn.innerHTML = `Connecting${ca}`;
		ca += '.';
	}, 500);
	changeColor(options.color);
	changeArmor(options.armor);
	setTimeout(() => {
		getServers()
			.then(servers => {
				window.totalPlayersOnline = 0;
				for (var i in servers) {
					window.totalPlayersOnline += servers[i].population;
				}
				checkPing(servers);
			})
			.catch(error => {
				clearInterval(Game.connectingAnimationLoop);
				btn.style.fontSize = '29px';
				btn.style.letterSpacing = '1px';
				btn.innerHTML = 'Error fetching servers.';
				btn.style.backgroundPosition = '100%';
				btn.style.cursor = '';
				log('Error fetching servers.', 'red');
			});
	}, 500);
}

