function updateMidPerkTimeout(p) {
	if (p.midPerkTimeout > 0) {
		p.midPerkTimeout -= 0.4;
		if (p.midPerkTimeout < 0) p.midPerkTimeout = 0;
	}
}

function updateBullet(bullet) {
	bullet.x += bullet.spdX / 2.5;
	bullet.y += bullet.spdY / 2.5;
}

function updateHpRadius(p) {
	var hpRadius = Math.round((p.hp * (p.radius - p.armor / 10 - 1)) / 100);
	if (p.hpRadius > hpRadius - 0.5 && p.hpRadius < hpRadius + 0.5) {
		p.hpRadius = hpRadius;
	}
	if (p.hpRadius > hpRadius) {
		p.hpRadius = p.hpRadius - 0.5;
	} else if (p.hpRadius < hpRadius) {
		p.hpRadius = p.hpRadius + 0.5;
	}
	if (p.hpRadius < 1) p.hpRadius = 1;
}

function updatePosition(p) {
	if (p.hp > 0 || p.dead) {
		p.x += p.spdX / 2.5;
		p.y += p.spdY / 2.5;
	}
}

function updateMiscObject(obj) {
	if (obj.type == 'landMine')
		if (!obj.radius > 0) {
			obj.angle = obj.angle + 12.5;
			obj.angle %= 360;
		}
	if (obj.timeAlive < obj.travelTime) {
		obj.x += obj.spdX / 2.5;
		obj.y += obj.spdY / 2.5;
	} else if (obj.radius < obj.maxRadius) {
		obj.radius += obj.expansionSpeed / 2.5;
		if (obj.radius > obj.maxRadius) obj.radius = obj.maxRadius;
	}
}

function updateViewbox(p) {
	var change = false;
	if (p.newVx > p.vx) {
		p.vx++;
		change = true;
	} else if (p.newVx < p.vx) {
		p.vx--;
		change = true;
	}
	if (p.newVy > p.vy) {
		p.vy++;
		change = true;
	} else if (p.newVy < p.vy) {
		p.vy--;
		change = true;
	}
	if (change) adjustCanvas(p);
}

function combineArrays(args) {
	let arr = [];
	for (let a of args) for (let b of a) arr.push(b);
	return arr;
}

function getAnimation(type, weapon, ammo, maxAmmo) {
	switch (weapon) {
		//smg
		case 0:
			if (type == 'shooting') {
				return models_smg_shooting;
			} else if (type == 'reloading') {
				return models_smg_reloading;
			}
			break;

		//pistol
		case 1:
			if (type == 'shooting') {
				return models_pistol_shooting;
			} else if (type == 'reloading') {
				return models_pistol_reloading;
			}
			break;

		//shotgun
		case 2:
			if (type == 'shooting') {
				return models_shotgun_shooting;
			} else if (type == 'reloading') {
				var fullReloadAnimation = [models_shotgun_reloading_1];
				for (i = 0; i < maxAmmo - ammo; i++)
					fullReloadAnimation.push(models_shotgun_reloading_2);
				fullReloadAnimation.push(models_shotgun_reloading_3);
				return combineArrays(fullReloadAnimation);
			}
			break;

		//assault
		case 3:
			if (type == 'shooting') {
				return models_assault_shooting;
			} else if (type == 'reloading') {
				return models_assault_reloading;
			}
			break;

		//sniper
		case 4:
			if (type == 'shooting') {
				return models_sniper_shooting;
			} else if (type == 'reloading') {
				if (!ammo)
					return combineArrays([
						models_sniper_reloading_1,
						models_sniper_reloading_2
					]);
				return models_sniper_reloading_1;
			}
			break;

		//lmg
		case 5:
			if (type == 'shooting') {
				return models_lmg_shooting;
			} else if (type == 'reloading') {
				return models_lmg_reloading;
			}
			break;
	}
}

function getObjectModel(name, vip = 0) {
	switch (name) {
		case 'crate':
			return models_crate_square;
		case 'longCrate':
			return models_crate_long;
		case 'userCrate':
			return vip ? models_crate_user_vip : models_crate_user;
        case 'medKit':
            return models_crate_medkit;
		case 'gas':
			return models_grenade_gas;
	}
}

