function drawPerks(selecting) {
	var x2 = canvas.x2;
	var y2 = canvas.y2;
	var passives = Object.keys(upgradeTypes1);
	var actives = Object.keys(upgradeTypes2);
	if (selecting[1])
		for (let i = 0; i < passives.length; i++)
			if (Game.player.perks[3] != passives[i])
				drawPerkImg(
					1,
					passives[i],
					(0.205 + i * 0.059) * x2,
					0.8575 * y2,
					0.0565 * x2,
					0.1 * y2,
					0.6
				);
	if (selecting[2])
		for (let i = 0; i < actives.length; i++)
			drawPerkImg(
				2,
				actives[i],
				(0.205 + i * 0.059) * x2,
				0.8575 * y2,
				0.0565 * x2,
				0.1 * y2,
				0.6
			);
	if (selecting[3])
		for (let i = 0; i < passives.length; i++)
			if (Game.player.perks[1] != passives[i])
				drawPerkImg(
					3,
					passives[i],
					(0.205 + i * 0.059) * x2,
					0.8575 * y2,
					0.0565 * x2,
					0.1 * y2,
					0.6
				);
}

function drawPerkImg(lvl, id, x, y, width, height, gAlpha, type) {
	var ctx = Game.canvas.ctx;
	var x2 = canvas.x2;
	var y2 = canvas.y2;
	ctx.globalAlpha = gAlpha;
	ctx.fillStyle = '#808080';
	ctx.fillRect(x, y, width, height);
	ctx.globalAlpha = 1;
	var lastClick = Game.extra.lastClick;
	var mouse = Game.extra.mouse;
	var xr = canvas.rxratio;
	var yr = canvas.ryratio;
	if (
		mouse[0] / xr >= x / window.devicePixelRatio &&
		mouse[0] / xr <= (x + width) / window.devicePixelRatio &&
		mouse[1] / yr >= y / window.devicePixelRatio &&
		mouse[1] / yr <= (y + height) / window.devicePixelRatio
	) {
		Game.extra.hovering = true;
		ctx.fillStyle = 'yellow';
		ctx.fillRect(x, y, width, height);
	}
	if (
		lastClick.x / xr >= x / window.devicePixelRatio &&
		lastClick.x / xr <= (x + width) / window.devicePixelRatio &&
		lastClick.y / yr >= y / window.devicePixelRatio &&
		lastClick.y / yr <= (y + height) / window.devicePixelRatio
	) {
		var upgradeBuf = new ArrayBuffer(3);
		var dv = new DataView(upgradeBuf);
		var obj = lvl == 2 ? upgradeTypes2 : upgradeTypes1;
		dv.setUint8(0, clPacketTypes.upgrade);
		dv.setUint8(1, lvl);
		dv.setUint8(2, obj[id]);
		Game.socket.send(upgradeBuf);
		Game.player.perks[lvl] = id;
		Game.player.selectingPerk[lvl] = false;
	}
	ctx.globalAlpha = gAlpha;
	if (type == 'new') {
		ctx.fillStyle = '#ffea88';
		ctx.fillRect(x + 0.0055 * x2, y + 0.009735 * y2, width * 0.8, height * 0.8);
	}
	drawScaledImage(
		ctx,
		images[id],
		x + 0.0055 * x2,
		y + 0.009735 * y2,
		width * 0.8,
		height * 0.8
	);
	ctx.globalAlpha = 1;
}

function drawBody(ctx, p) {
	if (p.dead) return;
	var pos = getRelPos(Game.canvas, p);
	if (Game.player.leaderboard.new.length >= 1) {
		var lb = Game.player.leaderboard.new.sort((a, b) => b.score - a.score);
		if (p.id == lb[0].id) {
			ctx.globalAlpha = 0.3;
			ctx.strokeStyle = colorHexes[p.color][0];
			ctx.lineWidth = 10;
			drawCirc(ctx, pos.x, pos.y, p.radius * 1.65);
		}
	}
	if (p.invincible) ctx.globalAlpha = 0.3;
	else ctx.globalAlpha = 1;
	if (p.dashing) {
		ctx.strokeStyle = '#b0b0b0';
		drawLine(pos.x, pos.y, pos.x - p.spdX * 5, pos.y - p.spdY * 5, 1, ctx);
		drawLine(
			pos.x,
			pos.y + 20,
			pos.x - p.spdX * 5,
			pos.y + 20 - p.spdY * 5,
			1,
			ctx
		);
		drawLine(
			pos.x,
			pos.y - 20,
			pos.x - p.spdX * 5,
			pos.y - 20 - p.spdY * 5,
			1,
			ctx
		);
		drawLine(
			pos.x + 20,
			pos.y,
			pos.x + 20 - p.spdX * 5,
			pos.y - p.spdY * 5,
			1,
			ctx
		);
		drawLine(
			pos.x - 20,
			pos.y,
			pos.x - 20 - p.spdX * 5,
			pos.y - p.spdY * 5,
			1,
			ctx
		);
	}
	ctx.lineWidth = 2;
	ctx.strokeStyle = '#666';
	ctx.fillStyle = '#666';
	drawCirc(ctx, pos.x, pos.y, p.radius + 1);
	ctx.fill();
	ctx.lineWidth = 1;
	ctx.strokeStyle = colorHexes[p.color][1];
	ctx.fillStyle = colorHexes[p.color][1];
	drawCirc(ctx, pos.x, pos.y, p.radius - p.armor / 10);
	ctx.fill();
	ctx.lineWidth = 1;
	ctx.strokeStyle = colorHexes[p.color][0];
	ctx.fillStyle = colorHexes[p.color][0];
	drawCirc(ctx, pos.x, pos.y, p.hpRadius + 1);
	ctx.fill();
	if (Game.extra.showNames && p.id != Game.player.id) {
		ctx.fillStyle = '#666';
		ctx.font = 'bold 12px Orbitron';
		ctx.textAlign = 'center';
		ctx.fillText(p.username, pos.x, pos.y + p.radius * 1.75);
		ctx.textAlign = 'start';
	}
	if (Game.extra.showNames) {
		var msg = p.chatMsg;
		if (!(Date.now() - p.chatDate > 3500) || p.chatboxOpen) {
			if ((msg == '' || Date.now() - p.chatDate > 3500) && p.chatboxOpen)
				msg = '...';
			if (msg.length > 0) {
				ctx.font = '12px Orbitron';
				ctx.textAlign = 'center';
				var msgWidth = ctx.measureText(msg).width;
				ctx.globalAlpha = 0.7;
				ctx.fillStyle = p.vip ? '#000' : '#7a7a7a';
				ctx.fillRect(
					pos.x - msgWidth / 2 - 3,
					pos.y + p.radius * 2.7 - 13,
					msgWidth + 6,
					18
				);
				ctx.globalAlpha = 1;
				ctx.fillStyle = p.vip ? '#deb34c' : '#FFF';
				ctx.fillText(msg, pos.x, pos.y + p.radius * 2.7);
				ctx.textAlign = 'start';
			}
		}
	}
	ctx.globalAlpha = 1;
}

function drawCirc(ctx, x, y, radius) {
	if (radius > 0) {
		ctx.beginPath();
		ctx.arc(x, y, radius, 0, 2 * Math.PI);
		ctx.stroke();
	}
}

function drawTriangle(ctx, side1, side2, side3) {
	ctx.beginPath();
	ctx.moveTo(side1.x, side1.y);
	ctx.lineTo(side2.x, side2.y);
	ctx.lineTo(side3.x, side3.y);
	ctx.fill();
}

function drawGrid(ctx) {
	//fill the grid based on the player's position
	var mx = Game.player.gameInfo.mapSize.x;
	var my = Game.player.gameInfo.mapSize.y;
	var relTl = getRelPos(Game.canvas, { x: 0, y: 0 });
	var relBr = getRelPos(Game.canvas, { x: mx, y: my });
	ctx.fillStyle = '#efeff5';
	ctx.fillRect(0, 0, relBr.x + 5000, relBr.y + 5000);
	var mode = Game.extra.gamemode;
	if (mode == 'FFA' || mode == 'TDM') {
		var squarePos = {
			x: relTl.x + mx / 2 - 200 / 2,
			y: relTl.y + my / 2 - 200 / 2
		};
		ctx.fillStyle = 'f9f9f9';
		ctx.fillRect(squarePos.x, squarePos.y, 200, 200);
	} else if (mode == 'DOM') {
		var squarePos = [
			{
				x: relTl.x + mx / 2 - 1000,
				y: relTl.y + my / 2 - 1000
			},
			{
				x: relTl.x + mx / 2 + 1000 - 200,
				y: relTl.y + my / 2 - 1000
			},
			{
				x: relTl.x + mx / 2 - 1000,
				y: relTl.y + my / 2 + 1000 - 200
			},
			{
				x: relTl.x + mx / 2 + 1000 - 200,
				y: relTl.y + my / 2 + 1000 - 200
			}
		];
		ctx.fillStyle = '#f9f9f9';
		for (var i = 0; i < squarePos.length; i++) {
			ctx.fillRect(squarePos[i].x, squarePos[i].y, 200, 200);
		}
	}
	ctx.strokeStyle = '#e3e3e8';
	for (var i = 0; i <= my; i += 20) {
		drawLine(relTl.x, relTl.y + i, relBr.x, relTl.y + i, 1, ctx);
	}
	for (var i = 0; i <= mx; i += 20) {
		drawLine(relTl.x + i, relTl.y, relTl.x + i, relBr.y, 1, ctx);
	}
	ctx.strokeStyle = '#aaa';
	ctx.lineWidth = 10;
	ctx.strokeRect(relTl.x, relTl.y, mx, my);
	if (mode == 'FFA' || mode == 'TDM') {
		var squarePos2 = {
			x: mx / 2 - 200 / 2,
			y: my / 2 - 200 / 2
		};
		var p = Game.player;
		if (
			p.x > squarePos2.x &&
			p.x < squarePos2.x + 200 &&
			p.y > squarePos2.y &&
			p.y < squarePos2.y + 200
		) {
			ctx.strokeStyle = '#00cc66';
		} else ctx.strokeStyle = '#aaa';
		ctx.lineWidth = 4;
		ctx.strokeRect(squarePos.x, squarePos.y, 200, 200);
	} else if (mode == 'DOM') {
		ctx.lineWidth = 4;
		for (var i = 1; i < 5; i++) {
			var sqCode = Game.player.squares[i];
			if (sqCode == 1) ctx.strokeStyle = '#f26740';
			else if (sqCode == 2) ctx.strokeStyle = '#8dd8f8';
			else ctx.strokeStyle = '#aaa';
			ctx.strokeRect(squarePos[i - 1].x, squarePos[i - 1].y, 200, 200);
		}
	}
}

function drawLine(startX, startY, endX, endY, width, ctx) {
	//ctx.globalAlpha = 0.2 - dark mode
	ctx.lineWidth = width;
	ctx.beginPath();
	ctx.moveTo(startX, startY);
	ctx.lineTo(endX, endY);
	ctx.stroke();
}

function getRelPos(p1, p2) {
	return {
		x: p2.x - p1.x,
		y: p2.y - p1.y
	};
}

