document.onkeydown = function(res) {
	if (
		Game &&
		(!Game.extra.chatboxOpen || keyBinds.chat.includes(res.keyCode)) &&
		(Game.player.spawned || Game.player.dead) &&
		usedKeys.includes(res.keyCode)
	) {
		res.preventDefault();
		for (let str of ['up', 'down', 'left', 'right', 'space', 'reload'])
			if (keyBinds[str].includes(res.keyCode))
				Game.socket.send(makeInput(1, keyCodes[str]));

		if (keyBinds.toggleNames.includes(res.keyCode)) {
			Game.extra.showNames = !Game.extra.showNames;
			var existingMsg;
			for (var msg of Game.player.msgQueue)
				if (msg.type == 'showNames') existingMsg = msg;
			if (!existingMsg) {
				Game.player.msgQueue.push({
					type: 'showNames',
					content: Game.extra.showNames ? 'shown' : 'hidden',
					initTime: Date.now()
				});
			} else {
				existingMsg.content = Game.extra.showNames ? 'shown' : 'hidden';
				existingMsg.initTime = Date.now();
			}
		}
		if (keyBinds.debug.includes(res.keyCode)) {
			if (Game.extra.chatboxOpen) {
				closeChatBox();
			} else {
				Game.extra.showDebug = !Game.extra.showDebug;
			}
		}
		if (enableKillbind && keyBinds.killbind.includes(res.keyCode)) {
			var buf = new ArrayBuffer(2);
			var dv = new DataView(buf);
			dv.setUint8(0, clPacketTypes.special);
			dv.setUint8(1, clPacketSpecialTypes.requestDeath);
			Game.socket.send(buf);
		}
		if (keyBinds.chat.includes(res.keyCode) && Game.player.spawned) {
			if (!Game.extra.chatboxOpen) {
				openChatBox();
			} else {
				closeChatBox();
			}
		}
	}
};

