var channel = new BroadcastChannel('multibox'),
	rand;
function checkMultibox() {
	rand = Math.random().toString(36);
	channel.postMessage(rand);
}
setInterval(checkMultibox, 5000);
channel.onmessage = r => {
	if (r != rand && Game && Game.socket && Game.socket.readyState == 1) {
		var buf = new ArrayBuffer(2);
		var dv = new DataView(buf);
		dv.setUint8(0, clPacketTypes.special);
		dv.setUint8(1, clPacketSpecialTypes.disconnectEveryConnectionFromMyIP);
		Game.socket.send(buf);
	}
};
checkMultibox();